    InputGroupAddon, Breadcrumb, BreadcrumbItem, ListGroup, ListGroupItem, Media
} from 'reactstrap';

import { useFormik } from 'formik';
import * as Yup from 'yup';
import Link from 'next/link';
import styles from './Chat.module.scss';

import { Email, Phone, Person, Group, Accessibility, Alarm,
        Message, ArrowRight, ArrowDropDown, Home, Repeat, Close,
} from '@styled-icons/material';

import DashboardLayout from "../../layouts/DashboardLayout";
import ChatGroup from "../../components/ChatGroup";



export default function Chat() {
    return (


        <DashboardLayout>
            <React.Fragment>

                <Row noGutters sm="3" style={{padding:"0px", margin:"-25px", }}>

{/* ------------------------------ List of Groups AND members ----------------------------------- */}
                    <Col sm="3" className={styles.groupslist}>
						<h4 className={"text-light my-5"}>Groups</h4>

                    	<ChatGroup />
						<ChatGroup />
						<ChatGroup />
						<ChatGroup />

                    </Col>

{/* ------------------------------ Main Chat Box ----------------------------------- */}

                    <Col sm="6">
					<div>

						<div style={{width:"100%", height:"80vh", position:"static", overflow:"auto", backgroundColor:"gray"}}>

						</div>
						<div style={{height:"20vh", width:"100%", backgroundColor:"red"}}>

						</div>
					</div>

                    </Col>

{/* ------------------------------Individual Profile right side pannel ----------------------------------- */}

                    <Col sm="3">

                       <Alert color="info"> profile dynamic</Alert>

                    </Col>


                </Row>




            </React.Fragment>

